  console.log(range_end);

  let count = 0;
  for(let i = range_start; i <= range_end; i++) {
    console.log(`i: ${i}`);
    console.log(`count: ${str.charCodeAt(count)}`);
    if (str.charCodeAt(count) != i) {
      //console.log(`count: ${str.charCodeAt(count)}`);
